import React from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import Home from './containers/public/signin/SignIn';
import Register from './containers/public/signup/SignUp';
import { NotesContainer } from './containers/Dashboard';
import Navbar from './components/navbar/Navbar';
import { Nomatch } from './containers/no-match/Nomatch';

import { AuthProvider, useAuth } from './utils/auth'; // Correct import statement

const App = () => {
  const { user } = useAuth(); // Using useAuth hook to get user and other authentication methods

  // If user is not authenticated, redirect to login page
  if (!user) {
    return <Navigate to="/" />;
  }

  // If authenticated, render the application
  return (
    <Router>
      <div>
        <Navbar />
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/register" element={<Register />} />
          <Route path="/notes" element={<NotesContainer />} />
          <Route path="/notes/:noteId" element={<NotesContainer />} />
          <Route path="/404" element={<Nomatch />} />
          <Route path='*' element={<Navigate to="/404" />} />
        </Routes>
      </div>
    </Router>
  );
};

export default App;
